- input: "TEXT\x1CC00214304\x1C.TEXT\x1C\x1CF3XA\x1CThis report is being amended to
    add disbursements for Bentley and Thomas as well as reflect a refund received
    from Hayes. The Hayes refund was previously reported as a regular disbursement,
    which decreased instead of increased reported cash-on-hand. The refunded check
    is due to a recount refund and ties back to the check originally issued by our
    political action committee on November 14, 2006, as reported in the 2006 Post
    Election Report. These disbursements and receipts were not reported in the initial
    filing due to an administrative error and were located during an internal audit.\n"
